  [],\n\t\"revision_timestamp\": \"2015-10-11T19:02:54.262067\",\n\t\"name\": \"archive-of-information-about-geosamples-curated-by-nmnh-collected-during-noaa-nos-and-uscgs-hyd\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Prior to August 2001, physical sediment
  samples collected by U.S. Coast and Geodetic Survey (USCGS) and NOAA National Ocean
  Service (NOS) personnel n          during hydrographic surveys were routinely sent
  to the Smithsonian Institution National Museum of Natural History (NMNH) for curation.
  n          USCGS and NOAA/NOS hydrographic party personnel also generated forms
  documenting and describing these samples. Both the samples and forms were sent to
  the Smithsonian.n          Smithsonian staff then key-entered information from the
  forms into the NMNH Paleobiology Sediment Collection database. NOAA discontinued
  the practice of sending samples to NMNH in September of 2001.n          Also in
  2001, NMNH gave NOAA's National Geophysical Data Center (NGDC) a copy of information
  from their database documenting USCGS and NOAA/NOS samples in their collections.n
  \         This was a one-time transfer to make the collection searchable via the
  Index to Marine and Lacustrine Geological Samples (IMLGS) database.  n          No
  further contributions to the IMLGS are expected from NMNH.\",\n\t\"license_title\":
